const express = require('express');
const app = express();
const port = process.env.PORT || 3030;


app.get("/", (req, res) => {
  res.json({
    msg: "Holas a todos",
  });
});

app.listen(port, () =>{
  console.log("El servicio se inicio en el puerto: ", port);
});
